import React from "react";
import Navbar from "./navbar";
import Footer from "./footer";
const Reviews = () => {
    return (
        <div className="Reviews">
            <header>
                <Navbar />
            </header>
            <main>
                <h1>Reviews</h1>
                <div class="button">
                <a href="/makereview" target="_blank" rel="noopener noreferrer">
                      <button className="button">create your own review here!</button>
                  </a>
                </div>
            </main>
            <footer>
                <Footer />
            </footer>
        </div>
    );
};

export default Reviews;
